						["TX"] = "His thick chin strap beard and straw blonde hair look wind tossed but not unappealing - at least by undead standards. Long bangs cover some of the holes in his face.\n\nDespite missing several teeth his smile is charming and easy. It rarely reaches his eyes, which are usually squinting slyly. ",
