			["about"] = {
				["v"] = 64,
				["BK"] = 2,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Introduction{/h1}\n\nHe leans against the wall with tight lips and a sleepy look in his eyes. The whites of his eyes glow dimly from within, yellow like foggy gnomish bulbs, a spark flickering in each pupil. Their luminescence makes eye color difficult to discern. In life his straw blond hair and thick chin strap beard might have made him ruggedly disheveled, though the affect is now lost to decay. \n\nSomething wriggles beneath his skin. It looks uncomfortable, even painful. Occasionally he twitches or stops to scratch at the source of the irritation. His brows pinch only slightly. If he's suffering he's not going to let it show.\n\nBy all appearences he seems to have adjusted well to undeath. Only the rum flask clutched in his right hand suggests otherwise. Whether the effect is merely psychosomatic even he cannot say. Best not to think about it. Why spoil one's own happiness with sobering questions?\n\n{h1:c}Before the Scourge{/h1}\n\nIf you lived in Tirisfal or the Capital City of Lordaeron during the plague, you might remember Lyle. You're not sure if his family lived in the city - you never met them and he never spoke of them - but you may have seen him walking the church grounds when he was alive. Or maybe you knew him from the seedy bar in Brill, where he wasted his teenage years gambling and bruising his knuckles until he found the Light's salvation. He seemed like an ordinary priest in those days, if a bit secretive. \n\nThat is not to say Lyle was ever without friends. He was highly gregarious and enjoyed the company of a variety of people from different walks of life, with few exceptions. You're not sure you ever saw him with a woman. \n\nWhen the plague struck Lyle and several other priests were dispatched to the surrounding towns and villages to investigate and heal the sick. While tending to the ill Lyle and his friends heard screams of horror coming from outside the make-shift hospital. Seeing the chaos outside the priests desperately tried to barracade the doors and windows. In moments the living dead burst through, claws and teeth glistening with bile and freshly spilled blood, and ravaged the hospital. Unable to save his friends, Lyle escaped through a second story window and fled in terror.\n\nOf Lyle's group only he returned to Lordaeron alive, bloodied and shaken to his core, one of the first unfortunate souls who beared witness to the plague's true nature. He never ventured beyond the city walls again... at least, not in life.\n\nLyle perished when the Scourge seiged Lordaeron. A dreadblade pierced him through from behind as he fled. In the following days his body was dragged from the mass grave in which it had been carelessly thrown, infused with necromancy, and sent to toil in the mines of Deathknell.\n\nPerhaps this was divine punishment. \n\n{h1:c}A New Purpose{/h1}\n\nAs the Lich King's power waned Lyle returned to his senses in Deathknell. Now shunned by the Light and riddled with flesh eating maggots, he wandered Tirisfal in a daze, seeking anything to distract him from his miserable new existance. Service to the Dark Lady seemed the only logical choice. Lordaeron was his home, after all. Who else but the undead would tolerate his presense now?\n\nWhile traveling through Silverpine he learned of an organization called the Hand of Lordaeron, whose Forsaken members sought to defend and reclaim their homeland from thieving Alliance and relentless Scourge alike. Intrigued, he joined their cause.\n\nAt first the Hand was merely a place to meet new friends and rest his feet. As time passed his dedication to Mortarion's goals deepened. The Hand blessed him with purpose and renewed vigor and he repays them in loyalty and the blood of their mutual enemies. \n\n{h1:c}The Forgotten Shadow{/h1}\n\nIn death Lyle's ambitions turned from giving life to ripping it away. While he will readily heal his companions when neccessity demands it (or they promise to repay him in drink) he claims to heal with \"Spite\" rather than Light. \n\nAs a follower of the Cult of the Forgotten Shadow, Lyle attempts to live by the three virtues of Respect, Tenacity, and Power. Strangely, his resentment for the Light does not prevent him from finding balance. The compulsion to lift up the weak and heal the wounded remains strong within his soul, stronger even than the Light's agonizing flames and inspired hatred, while the Shadow envelopes him in cold solace. It is the Shadow he favors. ",
				},
